 @rocha7152  Mas tu tá ligado que se não fosse o bom desempenho nas primeiras rodadas e vacilos de equipes que tavam lutando junto com o Fortaleza pelo G4, hj em dia era pra tá no meio da tabela, né?

Comparando com o Ceará, o Fortaleza tem 12 derrotas, é um time que quando não ganha, perde e muito feio! Já o Ceará é mt difícil de ser vencido, pois é o time que mais empatou durante o campeonato, e o time que até agora não foi goleado durante a temporada! 

Então comparando com o Ceará, Fortaleza é superestimado pela mídia só pelo fato de ser o único time nordestino à se manter bem na tabela (isso chega à ser ridículo, essa babação!). E caso consiga uma vaga pra libertadores, o Fortaleza se continuar nesse ritmo, vai ser humilhado de uma maneira cruel!

